    was written to guide management on Sunkhaze Meadows National Wildlife Refuge and
    Carlton Pond Waterfowl Production Area for the next 15 years. This plan outlines
    the Refuge vision and purpose and describes how the Refuge will contribute to the
    overall mission of the Refuge System. The plan provides an introduction to the Refuge,
    an overview of the CCP planning process, information about the environment, goals
